import React from 'react';
import s from './Friends.module.css';

const Friends = (props) => {
    return (
        (<div>
        <div className = {s.item}>
        My friends
    </div>
    <div className = {s.ava}>
           <img src = 'https://wl-adme.cf.tsp.li/resize/728x/jpg/214/dda/5fae555a5a94a24fd073a9a423.jpg' />
           <img src = 'https://screenfiction.org/content/image/0/5/184/924b45fd-full.webp' />
           <img src = 'https://screenfiction.org/content/image/0/5/188/c0483ced-regular.webp' />
    </div>
    </div>
    )
    );
}

export default Friends;
